import React from "react";
import Home from "../src/components/Home";
import { BrowserRouter, Route,Switch } from "react-router-dom";
import NotFound from "./components/NotFound";
import BodyCream from "./components/BodyCream";
import BodyLotion from "./components/BodyLotion";
import BodyMists from "./components/BodyMists";

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route component={NotFound} />
        <Route exact path="/BodyCream.js" component={BodyCream} />
        <Route exact path="/BodyLotion.js" component={BodyLotion} />
        <Route exact path="/BodyMists.js" component={BodyMists} />

        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
